import React from "react";
import { Link, useNavigate  } from "react-router-dom";


const Header = ({currentUser, logout}) => {
  const current_user = true;
  const navigate = useNavigate()
  const handleClick = () => {
  logout()
  navigate("/")
}
const renderAuthButtons = () => {
if (currentUser) {
  return (
    <>
      <button className="pixel-btn" role="button">
        Log Off
      </button>
      <Link to="/addgame">
        <button className="pixel-btn" role="button">
          Add Game
        </button>
      </Link>
    </>
  );
} else {
  return (
    <>
      <Link to="/signup">
        <button className="pixel-btn" role="button">
          Sign Up
        </button>
      </Link>
      <Link to="/signin">
        <button className="pixel-btn" role="button">
          Login
        </button>
      </Link>
    </>
  );
}
};

return (
<>
  <nav id="nav">
    <Link to="/">
      <button className="pixel-btn" role="button">
        Home
      </button>
    </Link>
    <Link to="/gameindex">
      <button className="pixel-btn" role="button">
        Browse
      </button>
    </Link>
    {renderAuthButtons()}
  </nav>
</>
);
}

export default Header;
